import React from "react";
import About from "../About/About";
import ChefOfTheWeek from "../ChefOfTheWeek/ChefOfTheWeek";
import DishIcons from "../DishIcons/DishIcons";
import DishSlide from "../DishSlide/DishSlide";
import Hero from "../Hero/Hero";
import PageButtons from "../PageButtons/PageButtons";
import RestaurantSlide from "../RestaurantSlide/RestaurantSlide";
import { useMediaQuery } from "react-responsive";

const Homepage = () => {
  const isDesktopScreen = useMediaQuery({ query: "(min-width: 600px)" });
  return (
    <>
      <Hero />
      <PageButtons />
      <RestaurantSlide />
      <DishSlide />
      <DishIcons />
      <ChefOfTheWeek />
      <About />
    </>
  );
};

export default Homepage;
